(window.webpackJsonp=window.webpackJsonp||[]).push([[11],{101:function(e){e.exports=JSON.parse('{"id":"e2e-tests","title":"End to End Tests","sidebar_label":"End to End Tests","description":"End to End (E2E) tests are high level tests that tests. Instead of testing lower level functionality, such as if components render correctly or functions take certain arguments, they test at the application level. These are typically the kinds of tests that you would run to check if you app works. We have chosen [Testcafe](https://github.com/DevExpress/testcafe) as our testing framework. It is a much nicer alternative to [webdriverio](http://webdriver.io), [spectron](https://electronjs.org/spectron), and [selenium](https://www.seleniumhq.org).","source":"@site/docs/e2e-tests.md","permalink":"/docs/e2e-tests","sidebar":"docs","next":{"title":"Internals","permalink":"/docs/internals"},"previous":{"title":"Component Tests","permalink":"/docs/component-tests"}}')}}]);